function UserCard() {
  return (
    <div className="fixed bottom-0 left-0 mb-4 ml-4 max-w-sm bg-white shadow-lg rounded-lg overflow-hidden">
      <div className="flex items-center px-6 py-4">
        <img className="w-12 h-12 rounded-full object-cover"></img>
        <div className="ml-4">
          <h2 className="text-lg font-semibold text-gray-900">Username</h2>
          <p className="text-gray-700">
            This is a description text under the username.
          </p>
        </div>
      </div>
    </div>
  );
}

export default UserCard;
